import React, { useState, useEffect } from 'react';
import API from '../services/api';
import { useNavigate } from 'react-router-dom';

export default function MyProfile() {
  const [user, setUser] = useState(null);
  const [editing, setEditing] = useState(false);
  const [form, setForm] = useState({});
  const navigate = useNavigate();

  useEffect(() => {
    (async () => {
      try {
        const res = await API.get('/profile/me');
        setUser(res.data);
        setForm({ name: res.data.name || '', bio: res.data.bio || '', avatarUrl: res.data.avatarUrl || '' });
      } catch (err) {
        // token expired or invalid -> redirect to login
        localStorage.removeItem('token');
        navigate('/login');
      }
    })();
  }, [navigate]);

  const handleUpdate = async () => {
    try {
      const res = await API.put('/profile', form);
      setUser(res.data);
      setEditing(false);
    } catch (err) {
      console.error(err);
    }
  };

  const logout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  if (!user) return <div className="container-xl py-16">Loading...</div>;

  return (
    <div className="container-xl py-12">
      <div className="max-w-3xl mx-auto bg-white p-8 rounded-xl shadow">
        <div className="flex justify-between items-center mb-6">
          <h2 className="text-xl font-semibold">My Profile</h2>
          <div className="flex gap-2">
            <button onClick={() => setEditing(!editing)} className="px-3 py-1 bg-indigo-600 text-white rounded">
              {editing ? 'Cancel' : 'Edit'}
            </button>
            <button onClick={logout} className="px-3 py-1 bg-red-500 text-white rounded">Logout</button>
          </div>
        </div>

        <div className="flex gap-6">
          <div className="w-32 h-32 bg-gray-100 rounded-full overflow-hidden flex items-center justify-center">
            {user.avatarUrl ? <img src={user.avatarUrl} alt="avatar" className="w-full h-full object-cover" /> : <span className="text-gray-400">No avatar</span>}
          </div>

          <div className="flex-1">
            {!editing ? (
              <>
                <h3 className="text-lg font-medium">{user.name || '—'}</h3>
                <p className="text-sm text-gray-600 mt-2">{user.bio || 'No bio provided.'}</p>

                <div className="mt-4">
                  <h4 className="text-sm font-medium">Style preferences</h4>
                  <div className="flex gap-2 flex-wrap mt-2">
                    {user.stylePreferences.length ? user.stylePreferences.map((s, i) => (
                      <span key={i} className="px-3 py-1 bg-gray-100 rounded-full">{s}</span>
                    )) : <span className="text-sm text-gray-500">Not set</span>}
                  </div>
                </div>
              </>
            ) : (
              <>
                <div className="mb-3">
                  <label className="block text-sm">Name</label>
                  <input value={form.name} onChange={(e)=>setForm({...form, name: e.target.value})} className="w-full p-2 border rounded" />
                </div>
                <div className="mb-3">
                  <label className="block text-sm">Bio</label>
                  <textarea value={form.bio} onChange={(e)=>setForm({...form, bio: e.target.value})} className="w-full p-2 border rounded" />
                </div>
                <div className="mb-3">
                  <label className="block text-sm">Avatar URL</label>
                  <input value={form.avatarUrl} onChange={(e)=>setForm({...form, avatarUrl: e.target.value})} className="w-full p-2 border rounded" />
                </div>
                <button onClick={handleUpdate} className="px-3 py-2 bg-green-600 text-white rounded">Save changes</button>
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
